
CREATE TABLE VIC_ROI.TBL_ACCOUNTSCHEDULE_DETAIL
(
  ACCOUNT_SCHEDULE_NBR            VARCHAR2(100 BYTE),
  IDMS_REGION                     VARCHAR2(100 BYTE),
  COMMENCEMENT_DATE               VARCHAR2(100 BYTE),
  FIRST_DUE                       VARCHAR2(100 BYTE),
  TERM                            VARCHAR2(100 BYTE),
  FREQUENCY                       VARCHAR2(100 BYTE),
  ADV_ARR                         VARCHAR2(100 BYTE),
  INTERIM_RENT                    VARCHAR2(100 BYTE),
  INCOME_TYPE_FEES                VARCHAR2(100 BYTE),
  EXPENSE_TYPE_FEES               VARCHAR2(100 BYTE),
  GUARANTEED_RESIDUAL             VARCHAR2(100 BYTE),
  BOOKING_DATE                    VARCHAR2(100 BYTE),
  PRODUCT                         VARCHAR2(100 BYTE),
  TAX_CLASS                       VARCHAR2(100 BYTE),
  FASB_CLASS                      VARCHAR2(100 BYTE),
  SECURITY_DEPOSIT_AMOUNT         VARCHAR2(100 BYTE),
  FUNDING_DATE                    VARCHAR2(100 BYTE),
  LOCATION                        VARCHAR2(100 BYTE),
  YIELD                           VARCHAR2(100 BYTE),
  TRANSACTION_START_DATE          VARCHAR2(100 BYTE),
  RESIDUAL_INSURANCE_PREMIUM_PCT  NUMBER(15,9),
  BOOK_YIELD                      NUMBER(15,9),
  ADVANCE_RENT                    NUMBER(15,9),
  PROCESS_FLAG                    INTEGER       DEFAULT 0,
  CREATION_DATE                   DATE          DEFAULT sysdate
)
TABLESPACE VIC_DATA
PCTUSED    40
PCTFREE    10
INITRANS   1
MAXTRANS   255
STORAGE    (
            INITIAL          64K
            MINEXTENTS       1
            MAXEXTENTS       2147483645
            PCTINCREASE      0
            FREELISTS        1
            FREELIST GROUPS  1
            BUFFER_POOL      DEFAULT
           )
LOGGING 
NOCOMPRESS 
NOCACHE
NOPARALLEL
MONITORING;



